import { makeStyles } from "@mui/styles"

const homeStyles = makeStyles (() =>({
    cardHome:{
        maxWidth: 340,
        border: 2,
        borderRadius:'12%',
        borderColor: 'red',
        color: '#ffffff',
    },
    title:{
        marginLeft: '25px',
    },
    }
))

export default homeStyles
